import fire from './firebaseconf.js';
import {Redirect} from 'react-router-dom';
let email="";
let password="";
const Signup=()=>{
    const signthisguy=()=>{
        fire.auth().createUserWithEmailAndPassword(email,password).then((res)=>{
                <Redirect to="/login"/>
            })
            .catch((e)=>{
            console.log("Error " + e);
        });
    }
    return (
        <div className="container">
            <div className="card-panel">
                <div className="row">
                    <div className="input-field col s6 offset-s3">
                        <input placeholder="Email" id="email" type="text" onChange={(x)=>{email=x.target.value}}/>
                        <label for="email">Email</label>
                    </div>
                </div>
                <div className="row">
                    <div className="input-field col s6 offset-s3">
                        <input placeholder="Password" id="password" type="password" onChange={(x)=>{password=x.target.value}}/>
                        <label for="password">password</label>
                    </div>
                </div>
                <center>
                    <button className="center-align btn-small wave-effect" onClick={signthisguy}> Signup </button>
                </center>
            </div>
        </div>
    );
}
export default Signup;
